 in die Zustandsklassen erfolgt aufgrund des Schadenbilds und des Schadensausmasses. Dabei kann ein Abwasserbauwerk direkt einer Klasse zugeteilt werden oder zuerst jeder Schaden einzeln klassifiziert werden. (Am Schluss bestimmt dann z.B. der schwerste Einzelschaden die Klassifizierung des gesamten Kanals (Abwasserbauwerk.BaulicherZustand)).','',ARRAY['kein_Plantyp_definiert']::qgep_od.plantype[],'true','integer','','','','','','','','','','',NULL,NULL);
